import React from 'react';
import { connect } from 'react-redux';
import Todo from './Todo';

const Todos = (props) => {
  console.log(props.todos);
  return (
    <div>
      {props.todos.map((todo) => (
        <Todo todo={todo} />
      ))}
    </div>
  );
};

const mapStateToProps = (state) => {
  return {
    todos: state.todos,
  };
};

export default connect(mapStateToProps)(Todos);
